import React from 'react';

class Contact extends React.Component {
    render(){
        return (
            <div className='ui_main'>
                <h2>Add Contact</h2>
                <form className='ui_form'>
                    <div className='field'>
                        <label>Name</label>
                        <input type = "text" name = "name" placeholder='Name' />
                    </div>
                </form>
            </div>
        )
    }
}

export default Contact;
